import './App.css';
import hide from './hide.svg';
import {useState} from 'react';

function App() {
  const [eye,seteye]=useState(show);
  const [email,setemail]=useState("");
  const [password,setpassword]=useState("");
  const emailchange=(event)=>{
    console.log(event)
    setemail(event.target.value);
   }
   const eyechange = ()=>{
    seteye(hide);
   };
      const passchange = event =>{setpassword(event.target.value);}
  return (
    <div className="App">
      <div className="App-div">
       <label style={{fontWeight: "bold",fontSize:"20px",position:"relative",left:"-10px"}} for="">Sign Up</label>
        <input type="text" name="email" value={email} onChange={emailchange}/>
        <label for="">Email</label>
        <input type="text" name="password" value={password} onChange={passchange}/>
        <label>Password</label>
        <img src={show} style={{height:"30px"}} onClick={eyechange}/>
        <button>SIGN UP</button>
        <label>Already a user?</label>
        <a href={""}>LOGIN</a>
      </div>
    </div>
  );
}

export default App;
